  122: {project: 'example3', date: '4/22/20'},
  },
  displayClicked: false
  }




  render(){

    let stateCopy = {...this.state};
    let stateCopyFocus = stateCopy.projects

  return(

  <div className={classes.ContentHolder}>

     <div className={classes.Header}> Landan <br></br> Early</div>
      <button onClick={() => this.setState({displayClicked: true})}>Hey click me</button>
      <button onClick={()=> this.setState({displayClicked: false})}>Im a button</button>
