          { Object.keys(stateCopyFocus).map(currentValue =>{
            return(
              <div className={classes.ContentContainer}>
              <div className={this.state.displayClicked ? classes.BoxDisplay2 : classes.Box}>
              <p>{stateCopy[currentValue].project}</p>
              </div>
              <p>Date Posted:{stateCopy[currentValue].date}</p>
              </div>
            )
          })



          }
      </div>
  </div>
);
  }
}
export default Contentholder;
